import React from 'react';
import ExpenceItem from './ExpenceItem.js';
import './Expences.css';
import Card from '../UI/card.js';

const Expenses = (props) => {
  return (
    <Card className="expenses">
      <ExpenceItem
        title={props.elm[0].title}
        amount={props.elm[0].amount}
        date={props.elm[0].date}
      />
      <ExpenceItem
        title={props.elm[1].title}
        amount={props.elm[1].amount}
        date={props.elm[1].date}
      />
      <ExpenceItem
        title={props.elm[2].title}
        amount={props.elm[2].amount}
        date={props.elm[2].date}
      />
      <ExpenceItem
        title={props.elm[3].title}
        amount={props.elm[3].amount}
        date={props.elm[3].date}
      />
    </Card>
  );
}

export default Expenses;
